function standards(){var a={cache:!1,dataType:"jsonp",url:"https://casit.illinoisstate.edu/cdn/includes/standards.json",async:!1,contentType:"application/json",jsonpCallback:"jsonCallback",dataType:"jsonp"};$.ajax(a).done(function(a){for(var n=a.items.length,s=a.copy,t=a.itemprop,e="",o=0;o<n;o++){var p=a.items[o].name;e+='<a href="'+a.items[o].link+'">'+p+"</a>",e+=o==n-1?"</p>":"  | "}var d="<p>";d+="&copy; "+s+" ",d+="<span itemprop='brand'>"+t+"</span><br />",d+=e,$("#standards").html(d)})}$(document).ready(function(){standards()});
